include 'config.php';
if (isset($_POST['signup'])){ //get data by post method
$name=($_POST['name']);            //save input into variables
$email=($_POST['email']);
$password=($_POST['password']);
$encrypted_password = md5($password);
$check=($_POST['check']);


$user_check = "SELECT * FROM users WHERE name = '$name' ";                // check user already exist or not
    $res = mysqli_query($con, $user_check);
    if(mysqli_num_rows($res) > 0){                                             
       echo '<script> alert( "Username  that you have entered is already exist!")</script>';
    }else{
        $user_check1 = "SELECT * FROM users WHERE email='$email'";                        // check email already exist or not
        $res1 = mysqli_query($con, $user_check1);
    if(mysqli_num_rows($res1) > 0){                                               
        echo '<script> alert( "Email  that you have entered is already exist!")</script>';
   }else{
    
    $sql= "INSERT INTO users(name,email,password,checked) VALUES ('$name','$email','$encrypted_password','$check')";      //save data into database
    $result=mysqli_query($con,$sql);
    if($result){
                                                          //alert if you signup successfully
      echo ("<script LANGUAGE='JavaScript'>                 
        window.alert(' Login Now  ');
       
        </script>");
    }else{                                                      //alert if you can't signup

        echo ("<script LANGUAGE='JavaScript'>
        window.alert(' Seomething went Wrong ');
       
        </script>");}
    }
}
